      try {
        // Try real API first
        await api.authenticateGoogleFit(mockAuthCode);
      } catch (apiError) {
        console.warn('API authentication failed:', apiError);
        // Just continue - we'll use mock data
      }

      // Simulate connection delay
      await new Promise(resolve => setTimeout(resolve, 1000));

      // Save connection status to local storage
      localStorage.setItem('google_fit_connected', 'true');
      setIsGoogleFitConnected(true);

      // Fetch initial health data
      await fetchHealthData();

      return true;
    } catch (error) {
      console.error('Failed to connect Google Fit:', error);
      setError('Failed to connect to Google Fit. Please try again.');
      return false;
    } finally {
      setLoading(false);
    }
  };

