        const result = await api.getPrediction(metrics);
        setPrediction(result);
        return result;
      } catch (apiError) {
        console.warn('API prediction failed:', apiError);

        // Generate mock prediction
        const mockPrediction = {
          HealthScore: Math.min(100, Math.max(0, 
            100 - 
            (metrics.BMI < 18.5 || metrics.BMI >= 30 ? 15 : metrics.BMI >= 25 ? 5 : 0) -
            (metrics.sbp >= 140 || metrics.dbp >= 90 ? 15 : metrics.sbp >= 120 || metrics.dbp >= 80 ? 5 : 0) -
            (metrics.glucose >= 126 ? 15 : metrics.glucose >= 100 ? 5 : 0) -
            (metrics.age >= 60 ? 5 : 0)
          )),
          riskLevel: "Generated Risk Level",
          advice: "This is a mockup health score based on your metrics. In a production environment, this would be a comprehensive AI-generated health assessment."
        };

