        }
      }

      setAiInsights(insights);

      return { symptom: newSymptom, insights };
    } catch (error) {
      console.error('Failed to add symptom:', error);
      throw error;
    }
  };

  // Load mock symptoms for demo
  const loadMockSymptoms = () => {
    const mockSymptoms = api.generateMockSymptoms();
    setSymptoms(mockSymptoms);

    // Also load mock insights
    const mockInsights = api.generateMockAIInsights();
    setAiInsights(mockInsights);
  };

  // Load initial data when authenticated
  useEffect(() => {
    const loadInitialData = async () => {
      if (isAuthenticated) {
        const connected = await checkGoogleFitConnection();
        // Only fetch health data if Google Fit is connected
        if (connected) {
          await fetchHealthData();
          await getBiorhythmAdvice('morning'); // Load default biorhythm advice
          // Also load mock symptoms for demo purposes
          loadMockSymptoms();
        }
      }
    };

    loadInitialData();
  }, [isAuthenticated]);

  // Value to be provided to consuming components
  const value = {
    loading,
    error,
    isGoogleFitConnected,
    healthMetrics,
    symptoms,
    prediction,
    biorhythmAdvice,
    aiInsights,
    environmentAdvice,
    lastRefreshTime,
    connectGoogleFit,
    fetchHealthData,
    addSymptom,
    getBiorhythmAdvice,
    getPrediction,
    getEnvironmentAdvice
  };

  return (
    <HealthDataContext.Provider value={value}>
      {children}
    </HealthDataContext.Provider>
  );
};

export default HealthDataProvider;
